INSERT INTO `showTimez_movies_playing` VALUES (4,'data:image/avif;base64,','Kalki AD-2898',' Action , Sci-Fi , Thriller','3h 00m','Prabhas','Amitabh Bachchan','Kamal Haasan','Deepika Padukone','Disha Patani','data:image/jpeg;base64,','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','Nag Ashwin(Director,Writer)',' Priyanka Dutt(Producer)','Santosh Narayanan(Musician)','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','Bhairava, weary of the oppressive confines of his homeland and the perilous life of a bounty hunter, yearns for a more comfortable existence in the Complex. His quest for a new life inadvertently entangles him with a group of rebels dedicated to freeing humanity from the grip of malevolent forces'),(7,'data:image/jpeg;base64,','Kill','Action , Thriller','3h20m','Lakshya Lalwani','Tanaya maniktala','Raghav Juyal','Ashish Vidhyarthi','Harsh Chhaya','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','data:image/jpeg;base64,','data:image/jpeg;base64,','Nikhil(Director,Writer)','Karan(Producer)','Apoorva(producer)','data:image/avif;base64,','data:image/avif;base64,','data:image/jpeg;base64,','A passenger train bound for New Delhi becomes a bloody battleground of brutal close-quarters combat as a pair of commandos square off against a 40-strong army of invading bandits'),(8,'data:image/avif;base64,','Sarfira',' Biography , Drama','2h 35m','Akshay Kumar','Pareshrawal','Radhika Madan','Seema Biswash','Prakash Belwadi','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','Sudha(Director)','Jyotika(Producer)','G.V Prakash(Musician','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','An incredible story, set in the world of startups and aviation, Sarfira will inspire the common man to dream big and to chase your dreams even if the world calls you crazy.'),(9,'data:image/avif;base64,','Deadpool & Wolverine','Action , Adventure , Comedy','2h 8m','Ryan Reynold','Hugh jackman','Emma Corrin','Morena Baccarin','Rob Delaney','data:image/jpeg;base64,','data:image/jpeg;base64,','data:image/jpeg;base64,','data:image/avif;base64,','data:image/jpeg;base64,','Kevin(Producer)','Shawn(Director)','Ryan(Producer)','data:image/jpeg;base64,','data:image/jpeg;base64,','data:image/jpeg;base64,','A listless Wade Wilson toils away in civilian life with his days as the morally flexible mercenary, Deadpool, behind him. But when his homeworld faces an existential threat, Wade must reluctantly suit-up again with an even more reluctant Wolverine.'),(10,'data:image/avif;base64,','Despicable Me 4','Action , Adventure , Animation , Comedy','1h 34m','Sofia vergara','Joey King','Stephen Colbert','Chloe Fineman','Miranda Cosgrove','data:image/jpeg;base64,','data:image/jpeg;base64,','data:image/avif;base64,','data:image/jpeg;base64,','data:image/avif;base64,','Chrish (Director)','Patrick(Director)','Mike(Screen Play)','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','Gru and Lucy and their girls — Margo, Edith and Agnes — welcome a new member to the Gru family, Gru Jr., who is intent on tormenting his dad. Gru faces a new nemesis in Maxime Le Mal and his femme fatale girlfriend Valentina, and the family is forced to go on the run.'),(12,'data:image/avif;base64,','Fly Me to the Moon','Comedy , Drama , Romantic','2h 14m','Scarlett Johanson','Chaning Tatum','Woody harrelson','Jim Rash','Ray romano','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','Scarlett (Producer)','Gerg(Director)','Dainiel (Musician)','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','Marketing maven Kelly Jones wreaks havoc on launch director Cole Davis\'s already difficult task. When the White House deems the mission too important to fail, Jones is directed to stage a fake moon landing as backup.');
INSERT INTO `showTimez_movies_playing` VALUES (13,'data:image/avif;base64,','Longlegs','Horror , Thriller','1h 43m','Manika Monroe','Nicolas Cage','Alicia Witt','Blair Underwood','Dakota daulby','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','data:image/jpeg;base64,','data:image/jpeg;base64,','Oz Perkins(Director,Writer)','Nicolas (Producer)','Jason Cloth','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','FBI Agent Lee Harker, a gifted recruit, is assigned the unsolved case of an elusive serial killer. While unearthing evidence, Harker discovers a personal connection to the merciless killer and must race against time to stop him before he claims the lives of another innocent family.'),(14,'data:image/avif;base64,','Jatt & Juliet 3','Comedy , Romantic','2h 17m','Diljit Dosanjh','Neeru Bajwa','Jasmin Bajwa','B.N Shrama','Rana Rnbir','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','Jagdeep(Director,Writer)','Gunbir(Producer)','Manmord (Producer)','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','A battle of wits begins as Fateh joins the police force and meets his charming boss, Pooja, sparking a romantic comedy of unexpected twists. Will Pooja fall into Fateh`s honey trap, or will Cupid`s arrow lead to real love as they embark on an important mission in this rib-tickling affair?'),(15,'data:image/avif;base64,','Inside Out 2',' Animation , Comedy , Drama','1h 36m','Kensington Tallman','Ananya Panday','Amy Poehler','Maya hawke','Lewis Black','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','Kelsey(Director)','Meg(Writer)','Michael(Musician)','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','Disney and Pixar`s \"Inside Out 2\" returns to the mind of newly minted teenager Riley just as headquarters is undergoing a sudden demolition to make room for something entirely unexpected: new emotions! Joy, Sadness, Anger, Fear and Disgust, who`ve long been running a successful operation by all accounts, aren`t sure how to feel when Anxiety shows up. And it looks like she`s not alone'),(16,'data:image/avif;base64,','Twisters','Action , Adventure , Thriller','2h 2m','Daisy Edgar','Glen Powell','Anthony Ramos','Maura Tierney','Sasha Lane','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','Lee Isaac (Director)','Frank(producer)','Patrick(Producer)','data:image/avif;base64,','data:image/avif;base64,','data:image/avif;base64,','Kate Cooper, haunted by a devastating encounter with a tornado during her college years, studies storm patterns on screens safely in New York City. She is lured back to the open plains by her friend, Javi to test a groundbreaking new tracking system.');
